//frontend/src/components/ui/card.jsx
import React from 'react';
import classNames from 'classnames';

export const Card = ({ children, className = '', ...props }) => {
  return (
    <div
      className={classNames(
        'bg-white rounded-2xl shadow-md p-6 border border-gray-200',
        className
      )}
      {...props}
    >
      {children}
    </div>
  );
};

export const CardHeader = ({ children, className = '' }) => {
  return (
    <div className={classNames('mb-4 font-semibold text-lg text-gray-800', className)}>
      {children}
    </div>
  );
};

export const CardContent = ({ children, className = '' }) => {
  return (
    <div className={classNames('text-sm text-gray-700', className)}>
      {children}
    </div>
  );
};

export const CardFooter = ({ children, className = '' }) => {
  return (
    <div className={classNames('mt-4 border-t pt-4 text-right', className)}>
      {children}
    </div>
  );
};
